import React from 'react';
import './App.css';
import IntroductionPage from './components/IntroductionPage/IntroductionPage.js'
import NavigationBar from './components/NavigationBar/NavigationBar.js'
import 'tachyons'


function App() {




  return (
    <div className="App">
      <NavigationBar/>
      <IntroductionPage/>
      <AboutMePage/>
      <ProjectsPage/>
      <AwardsPage/>
      <ContactFooter/>
    </div>
  );
}

export default App;
